Scripts.OnMouseUp:
if ( self.isMoving ) then
    self:StopMovingOrSizing();
    self.isMoving = false;
end

Scripts.OnHide:
if ( self.isMoving ) then
    self:StopMovingOrSizing();
    self.isMoving = false;
end

Scripts.OnClick:
												PlaySound(856,"Master");
												if( CP_PlayerListWindow:IsVisible() ) then
    												HideUIPanel( CP_PlayerListWindow );
												else
    												CensusPlus_ShowPlayerList();
												end

Scripts.OnMouseUp:
if ( self.isMoving ) then
    self:StopMovingOrSizing();
    self.isMoving = false;
end

Scripts.OnHide:
if ( self.isMoving ) then
    self:StopMovingOrSizing();
    self.isMoving = false;
end
